import React from "react";
import './MealSummary.css'
const MealsSummary = () => {
    return(
        <section className="summary">
            <h2>Delicious food delivered to you</h2>
            <p>
                Choose your favourite meal from our brad selection of available meals
                 and enjoy a delicious lunch for dinner at home
            </p>
            <p>
                All meals are cooked with high quality of ingredients , just-in-time and of course
                and of course by experienced chefs
            </p>

        </section>
    )

}
export default MealsSummary;
